```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>

SELECT ?person ?party WHERE {
  ?person a dbpedia-owl:OfficeHolder ;
            dbpedia-owl:isPolitician .
  OPTIONAL { ?person rdf:type dbpedia:PoliPartyMember . }
  FILTER (lang(?person) = "fr")  # Assuming the individuals are French
}
```

This query selects individuals (`?person`) who are both Office Holders and Politicians (`dbpedia-owl:OfficeHolder` and `dbpedia-owl:isPolitician`). It then optionally looks for a membership in a political party (`dbpedia:PoliPartyMember`) to infer their party affiliation.

