SELECT ?person WHERE {
  ?person a dbpedia:Person;
  dbpedia:partOfMilitaryConflict dbpedia:Thirty_Years'_War;
  OPTIONAL { ?person rdfs:label ?name }
  FILTER (lang(?name) = "en") 
} 

This query looks for individuals involved in the Thirty Years' War and retrieves their labels in English. It does not directly answer the question about a commander or the father of Ferdinand III's child due to the complexity and potential ambiguity in the question.

The SPARQL query to retrieve this information from DBpedia would be:

```sparql
SELECT ?child WHERE {
  ?child a dbpedia:Royalty ;
            dbpedia:P31 dbpedia:Yeshaq I .
  ?child dbo:hasParent ?parent .
  ?parent a dbpedia:Person ;
          dbpedia:P31 ?Na'od .
}
```

This query selects all individuals (`?child`) who are both royalties (`a dbpedia:Royalty`) and children of Yeshaq I (`?child P31 dbpedia:Yeshaq I`). It then filters these results to ensure that the identified child (`?child`) also has Na'od as a parent (`?child dbo:hasParent ?parent` where `?parent P31 ?Na'od`).

