1. Are a royalty (`a dbpedia-owl:Royalty`),
2. Have a parent (`?parent`), indicating their lineage,
3. Participated in the Siege of Mukha (`dbpprop:participatedInEvent dbpedia:Event:Mukha_Siege_1277`),
4. Have a child named Baeda Maryam I (`?child` with `dbpprop:name "Baeda Maryam I"`),
5. The parent of these royals is a commander (`?parent` with `dbpprop:role "Commander"`).

